	// HasKanjis applies the HasEdge predicate on the "kanjis" edge.
	func HasKanjis() predicate.Vocabulary {
		return predicate.Vocabulary(func(s *sql.Selector) {
		step := sqlgraph.NewStep(
				sqlgraph.From(Table, FieldID),
					sqlgraph.To(KanjisTable, FieldID),
			sqlgraph.Edge(sqlgraph.M2M, false, KanjisTable,KanjisPrimaryKey...),
		)
		sqlgraph.HasNeighbors(s, step)
	})
	}
	
	// HasKanjisWith applies the HasEdge predicate on the "kanjis" edge with a given conditions (other predicates).
	func HasKanjisWith(preds ...predicate.Kanji) predicate.Vocabulary {
		return predicate.Vocabulary(func(s *sql.Selector) {
		step := sqlgraph.NewStep(
				sqlgraph.From(Table, FieldID),
					sqlgraph.To(KanjisInverseTable, FieldID),
			sqlgraph.Edge(sqlgraph.M2M, false, KanjisTable,KanjisPrimaryKey...),
		)
		sqlgraph.HasNeighborsWith(s, step, func(s *sql.Selector) {
			for _, p := range preds {
				p(s)
			}
		})
	})
	}


// And groups predicates with the AND operator between them.
func And(predicates ...predicate.Vocabulary) predicate.Vocabulary {
	return predicate.Vocabulary(func(s *sql.Selector) {
		s1 := s.Clone().SetP(nil)
		for _, p := range predicates {
			p(s1)
		}
		s.Where(s1.P())
	})
}

// Or groups predicates with the OR operator between them.
func Or(predicates ...predicate.Vocabulary) predicate.Vocabulary {
	return predicate.Vocabulary(func(s *sql.Selector) {
		s1 := s.Clone().SetP(nil)
		for i, p := range predicates {
			if i > 0 {
				s1.Or()
			}
			p(s1)
		}
		s.Where(s1.P())
	})
}

// Not applies the not operator on the given predicate.
func Not(p predicate.Vocabulary) predicate.Vocabulary {
	return predicate.Vocabulary(func(s *sql.Selector) {
		p(s.Not())
	})
}





